wikibase-listdatatypes-globe-coordinate-:
Dobesedni podatki za geografski položaj, podani kot par zemljepisne širine in dolžine v SMS (° ' ") ali decimalnih stopinjah za dano nebesno telo. Privzeto je »Zemlja« in nato »WGS84«. Doda ločljivost in razpon vrednosti.
* zemljepisna širina – implicitni prvi del (float, dms, dm, dd) koordinatnega niza, smer je podana s predponskim znakom ali s pripono N ali S;
* zemljepisna dolžina – implicitni drugi del (float, dms, dm, dd) koordinatnega niza, smer je podana s predponskim znakom ali s pripono E ali W;
* globus – eksplicitna (?) podatkovna vrednost, podana kot nebesno telo, ki je privzeto Zemlja »http://www.wikidata.org/entity/Q2«;
* natančnost – številska natančnost koordinate

wikibase-listdatatypes-quantity-body:
Črkovno podatkovno polje za količino, ki se nanaša na neko vrsto dobro opredeljene enote. Dejanska enota spada v vnesene podatkovne vrednosti:
* amount – implicitni del niza (preslikava predpone enote ni jasna);
* unit – implicitni del niza, ki je privzeto nastavljen na »1« (preslikava na standardizacijski organ ni jasna);
* upperbound – zgornja meja količine;
* lowerbound – spodnja meja količine.

wikibase-listdatatypes-monolingualtext-b:
Črkovno podatkovno polje za niz, ki ni preveden v druge jezike. Ta vrsta niza je opredeljena enkrat in znova uporabljena v vseh jezikih. Ynačilna uporaba so zemljepisna imena, napisana v lokalnem jeziku, identifikator, kemijska formula ali znanstveno ime:
* language – eksplicitna vrednost za identifikacijo jezika za besedilni del;
* value – eksplicitna vrednost za niz jezikovne različice.

wikibase-listdatatypes-multilingualtext-:
Črkovno podatkovno polje za niz, ki ga je treba prevesti v druge jezike. Tipična uporaba je ime entitete globalnega pomena, ki ima nelokalne pisne oblike. Te se lahko razlikujejo v jezikih in pisavah:
* language – eksplicitna vrednost za identifikacijo jezika za besedilni del;
* value – eksplicitna vrednost za niz jezikovne različice.

wikibase-listdatatypes-time-body:
Črkovno podatkovno polje za časovno točko. Podano kot datum in čas z določeno natančnostjo in mejami. Čas se shrani interno v izbranem koledarskem modelu.
* time – eksplicitna vrednost za časovno točko, predstavljena kot časovni žig, podoben ISO 8601, npr. +2013-01-01T00:00:00Z. Leto je vedno predpisano in dopolnjeno tako, da ima od 4 do 16 števk.
* timezone – eksplicitna vrednost kot predpisano celo število. Podatki o časovnem pasu kot odmik od UTC v minutah.
* before – eksplicitna celoštevilska vrednost za število enot po danem času. Enota je podana s »precision« (glejte spodaj);
* after – eksplicitna celoštevilska vrednost števila enot pred danim časom. Enota je podana s »precision« (glejte spodaj);
* precision – eksplicitna vrednost, kodirana kot kratko celo število z naslednjim pomenom: 0 – milijarda let, 1 – sto milijonov let, ..., 6 – tisočletje, 7 – stoletje, 8 – desetletje, 9 – leto, 10 – mesec, 11 – dan, 12 – ura, 13 – minuta, 14 – sekunda;
* calendarmodel – eksplicitna vrednost, podana kot URI. Označuje koledarski model časovnega žiga.
